import Form from './Form';
import FormSubmittedPage from './FormSubmittedPage';
import './index.css'
import { BrowserRouter as Router,Route } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
      <Form />
      <Route path="/form-submitted" component={FormSubmittedPage} />
    </div>
    </Router>
  );
}

export default App;
